                ShowPinForProperties(76)=(PropertyName="LumenDiffuseColorBoost",PropertyFriendlyName="Diffuse Color Boost",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenDiffuseColorBoost", "Allows brightening indirect lighting by calculating material diffuse color for indirect lighting as pow(DiffuseColor, 1 / DiffuseColorBoost). Values above 1 (original diffuse color) aren\'t physically correct, but they can be useful as an art direction knob to increase the amount of bounced light in the scene. Best to keep below 2 as it also causes reflections to be brighter than the scene."),CategoryName="Global Illumination|Lumen Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(77)=(PropertyName="LumenSkylightLeaking",PropertyFriendlyName="Skylight Leaking",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenSkylightLeaking", "Controls what fraction of the skylight intensity should be allowed to leak.  This can be useful as an art direction knob (non-physically based) to keep indoor areas from going fully black."),CategoryName="Global Illumination|Lumen Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(78)=(PropertyName="LumenFullSkylightLeakingDistance",PropertyFriendlyName="Full Skylight Leaking Distance",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenFullSkylightLeakingDistance", "Controls the distance from a receiving surface where skylight leaking reaches its full intensity.  Smaller values make the skylight leaking flatter, while larger values create an Ambient Occlusion effect."),CategoryName="Global Illumination|Lumen Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(79)=(PropertyName="LumenSurfaceCacheResolution",PropertyFriendlyName="Scene Capture Cache Resolution Scale",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenSurfaceCacheResolution", "Scale factor for Lumen Surface Cache resolution, for Scene Capture.  Smaller values save GPU memory, at a cost in quality.  Defaults to 0.5 if not overridden."),CategoryName="Global Illumination|Lumen Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(80)=(PropertyName="RayTracingGIType",PropertyFriendlyName="Type",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingGIType", "Sets the ray tracing global illumination type."),CategoryName="Global Illumination|Ray Tracing Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(81)=(PropertyName="RayTracingGIMaxBounces",PropertyFriendlyName="Max. Bounces",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingGIMaxBounces", "Sets the ray tracing global illumination maximum bounces."),CategoryName="Global Illumination|Ray Tracing Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(82)=(PropertyName="RayTracingGISamplesPerPixel",PropertyFriendlyName="Samples Per Pixel",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingGISamplesPerPixel", "Sets the samples per pixel for ray tracing global illumination."),CategoryName="Global Illumination|Ray Tracing Global Illumination",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(83)=(PropertyName="ReflectionMethod",PropertyFriendlyName="Method",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:ReflectionMethod", "Chooses the Reflection method. Not compatible with Forward Shading."),CategoryName="Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(84)=(PropertyName="LumenReflectionQuality",PropertyFriendlyName="Quality",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenReflectionQuality", "Scales the Reflection quality.  Larger scales reduce noise in reflections, but increase GPU cost."),CategoryName="Reflections|Lumen Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(85)=(PropertyName="LumenRayLightingMode",PropertyFriendlyName="Ray Lighting Mode",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenRayLightingMode", "Controls how Lumen rays are lit when Lumen is using Hardware Ray Tracing.  By default, Lumen uses the Surface Cache for best performance, but can be set to \'Hit Lighting\' for higher quality."),CategoryName="Reflections|Lumen Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(86)=(PropertyName="LumenFrontLayerTranslucencyReflections",PropertyFriendlyName="High Quality Translucency Reflections",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LumenFrontLayerTranslucencyReflections", "Whether to use high quality mirror reflections on the front layer of translucent surfaces.  Other layers will use the lower quality Radiance Cache method that can only produce glossy reflections.  Increases GPU cost when enabled."),CategoryName="Reflections|Lumen Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(87)=(PropertyName="ScreenSpaceReflectionIntensity",PropertyFriendlyName="Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:ScreenSpaceReflectionIntensity", "Enable/Fade/disable the Screen Space Reflection feature, in percent, avoid numbers between 0 and 1 fo consistency"),CategoryName="Reflections|Screen Space Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(88)=(PropertyName="ScreenSpaceReflectionQuality",PropertyFriendlyName="Quality",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:ScreenSpaceReflectionQuality", "0=lowest quality..100=maximum quality, only a few quality levels are implemented, no soft transition, 50 is the default for better performance."),CategoryName="Reflections|Screen Space Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(89)=(PropertyName="ScreenSpaceReflectionMaxRoughness",PropertyFriendlyName="Max Roughness",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:ScreenSpaceReflectionMaxRoughness", "Until what roughness we fade the screen space reflections, 0.8 works well, smaller can run faster"),CategoryName="Reflections|Screen Space Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(90)=(PropertyName="RayTracingReflectionsMaxRoughness",PropertyFriendlyName="Max Roughness",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingReflectionsMaxRoughness", "Sets the maximum roughness until which ray tracing reflections will be visible (lower value is faster). Reflection contribution is smoothly faded when close to roughness threshold. This parameter behaves similarly to ScreenSpaceReflectionMaxRoughness."),CategoryName="Reflections|Ray Tracing Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(91)=(PropertyName="RayTracingReflectionsMaxBounces",PropertyFriendlyName="Max. Bounces",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingReflectionsMaxBounces", "Sets the maximum number of ray tracing reflection bounces."),CategoryName="Reflections|Ray Tracing Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(92)=(PropertyName="RayTracingReflectionsSamplesPerPixel",PropertyFriendlyName="Samples Per Pixel",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingReflectionsSamplesPerPixel", "Sets the samples per pixel for ray traced reflections."),CategoryName="Reflections|Ray Tracing Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(93)=(PropertyName="RayTracingReflectionsShadows",PropertyFriendlyName="Shadows",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingReflectionsShadows", "Sets the reflected shadows type."),CategoryName="Reflections|Ray Tracing Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(94)=(PropertyName="RayTracingReflectionsTranslucency",PropertyFriendlyName="Include Translucent Objects",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:RayTracingReflectionsTranslucency", "Enables ray tracing translucency in reflections."),CategoryName="Reflections|Ray Tracing Reflections",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(95)=(PropertyName="AmbientCubemapTint",PropertyFriendlyName="Tint",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientCubemapTint", "AmbientCubemap tint color"),CategoryName="Rendering Features|Ambient Cubemap",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(96)=(PropertyName="AmbientCubemapIntensity",PropertyFriendlyName="Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientCubemapIntensity", "To scale the Ambient cubemap brightness\n>=0: off, 1(default), >1 brighter"),CategoryName="Rendering Features|Ambient Cubemap",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(97)=(PropertyName="AmbientCubemap",PropertyFriendlyName="Cubemap Texture",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientCubemap", "The Ambient cubemap (Affects diffuse and specular shading), blends additively which if different from all other settings here"),CategoryName="Rendering Features|Ambient Cubemap",bCanToggleVisibility=True)
                ShowPinForProperties(98)=(PropertyName="CameraShutterSpeed",PropertyFriendlyName="Shutter Speed (1/s)",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:CameraShutterSpeed", "The camera shutter in seconds."),CategoryName="Lens|Camera",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(99)=(PropertyName="CameraISO",PropertyFriendlyName="ISO",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:CameraISO", "The camera sensor sensitivity"),CategoryName="Lens|Camera",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(100)=(PropertyName="DepthOfFieldFstop",PropertyFriendlyName="Aperture (F-stop)",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:DepthOfFieldFstop", "Defines the opening of the camera lens, Aperture is 1/fstop, typical lens go down to f/1.2 (large opening), larger numbers reduce the DOF effect"),CategoryName="Lens|Camera",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(101)=(PropertyName="DepthOfFieldMinFstop",PropertyFriendlyName="Maximum Aperture (min F-stop)",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:DepthOfFieldMinFstop", "Defines the maximum opening of the camera lens to control the curvature of blades of the diaphragm. Set it to 0 to get straight blades."),CategoryName="Lens|Camera",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(102)=(PropertyName="DepthOfFieldBladeCount",PropertyFriendlyName="Number of diaphragm blades",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:DepthOfFieldBladeCount", "Defines the number of blades of the diaphragm within the lens (between 4 and 16)."),CategoryName="Lens|Camera",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(103)=(PropertyName="AutoExposureBias",PropertyFriendlyName="Exposure Compensation",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureBias", "Logarithmic adjustment for the exposure. Only used if a tonemapper is specified.\n0: no adjustment, -1:2x darker, -2:4x darker, 1:2x brighter, 2:4x brighter, ..."),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(104)=(PropertyName="AutoExposureApplyPhysicalCameraExposure",PropertyFriendlyName="Apply Physical Camera Exposure",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureApplyPhysicalCameraExposure", "Only affects Manual exposure mode."),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(105)=(PropertyName="AutoExposureBiasCurve",PropertyFriendlyName="Exposure Compensation Curve",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureBiasCurve", "Exposure compensation based on the scene EV100.\nUsed to calibrate the final exposure differently depending on the average scene luminance.\n0: no adjustment, -1:2x darker, -2:4x darker, 1:2x brighter, 2:4x brighter, ..."),CategoryName="Lens|Exposure",bShowPin=True,bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(106)=(PropertyName="AutoExposureMeterMask",PropertyFriendlyName="Exposure Metering Mask",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureMeterMask", "Exposure metering mask. Bright spots on the mask will have high influence on auto-exposure metering\nand dark spots will have low influence."),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(107)=(PropertyName="AutoExposureLowPercent",PropertyFriendlyName="Low Percent",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureLowPercent", "The eye adaptation will adapt to a value extracted from the luminance histogram of the scene color.\nThe value is defined as having x percent below this brightness. Higher values give bright spots on the screen more priority\nbut can lead to less stable results. Lower values give the medium and darker values more priority but might cause burn out of\nbright spots.\n>0, <100, good values are in the range 70 .. 80"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(108)=(PropertyName="AutoExposureHighPercent",PropertyFriendlyName="High Percent",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureHighPercent", "The eye adaptation will adapt to a value extracted from the luminance histogram of the scene color.\nThe value is defined as having x percent below this brightness. Higher values give bright spots on the screen more priority\nbut can lead to less stable results. Lower values give the medium and darker values more priority but might cause burn out of\nbright spots.\n>0, <100, good values are in the range 80 .. 95"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(109)=(PropertyName="AutoExposureMinBrightness",PropertyFriendlyName="Min Brightness",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureMinBrightness", "Auto-Exposure minimum adaptation. Eye Adaptation is disabled if Min = Max.\nAuto-exposure is implemented by choosing an exposure value for which the average luminance generates a pixel brightness equal to the Constant Calibration value.\nThe Min/Max are expressed in pixel luminance (cd/m2) or in EV100 when using ExtendDefaultLuminanceRange (see project settings)."),CategoryName="Lens|Exposure",bShowPin=True,bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(110)=(PropertyName="AutoExposureMaxBrightness",PropertyFriendlyName="Max Brightness",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureMaxBrightness", "Auto-Exposure maximum adaptation. Eye Adaptation is disabled if Min = Max.\nAuto-exposure is implemented by choosing an exposure value for which the average luminance generates a pixel brightness equal to the Constant Calibration value.\nThe Min/Max are expressed in pixel luminance (cd/m2) or in EV100 when using ExtendDefaultLuminanceRange (see project settings)."),CategoryName="Lens|Exposure",bShowPin=True,bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(111)=(PropertyName="AutoExposureSpeedUp",PropertyFriendlyName="Speed Up",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureSpeedUp", "In F-stops per second, should be >0"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(112)=(PropertyName="AutoExposureSpeedDown",PropertyFriendlyName="Speed Down",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AutoExposureSpeedDown", "In F-stops per second, should be >0"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(113)=(PropertyName="HistogramLogMin",PropertyFriendlyName="Histogram Log Min",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:HistogramLogMin", "Histogram Min value. Expressed in Log2(Luminance) or in EV100 when using ExtendDefaultLuminanceRange (see project settings)"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(114)=(PropertyName="HistogramLogMax",PropertyFriendlyName="Histogram Log Max",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:HistogramLogMax", "Histogram Max value. Expressed in Log2(Luminance) or in EV100 when using ExtendDefaultLuminanceRange (see project settings)"),CategoryName="Lens|Exposure",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(115)=(PropertyName="LocalExposureHighlightContrastScale",PropertyFriendlyName="Highlight Contrast Scale",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureHighlightContrastScale", "Local Exposure decomposes luminance of the frame into a base layer and a detail layer.\nContrast of the base layer is reduced based on this value.\nValue less than 1 will enable local exposure.\nGood values are usually in the range 0.6 .. 1.0."),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(116)=(PropertyName="LocalExposureShadowContrastScale",PropertyFriendlyName="Shadow Contrast Scale",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureShadowContrastScale", "Local Exposure decomposes luminance of the frame into a base layer and a detail layer.\nContrast of the base layer is reduced based on this value.\nValue less than 1 will enable local exposure.\nGood values are usually in the range 0.6 .. 1.0."),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(117)=(PropertyName="LocalExposureDetailStrength",PropertyFriendlyName="Detail Strength",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureDetailStrength", "Local Exposure decomposes luminance of the frame into a base layer and a detail layer.\nValue different than 1 will enable local exposure.\nThis value should be set to 1 in most cases."),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(118)=(PropertyName="LocalExposureBlurredLuminanceBlend",PropertyFriendlyName="Blurred Luminance Blend",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureBlurredLuminanceBlend", "Local Exposure decomposes luminance of the frame into a base layer and a detail layer.\nBlend between bilateral filtered and blurred luminance as the base layer.\nBlurred luminance helps preserve image appearance and specular highlights, and reduce ringing.\nGood values are usually in the range 0.4 .. 0.6"),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(119)=(PropertyName="LocalExposureBlurredLuminanceKernelSizePercent",PropertyFriendlyName="Blurred Luminance Kernel Size Percent",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureBlurredLuminanceKernelSizePercent", "Kernel size (percentage of screen) used to blur frame luminance."),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(120)=(PropertyName="LocalExposureMiddleGreyBias",PropertyFriendlyName="Middle Grey Bias",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LocalExposureMiddleGreyBias", "Logarithmic adjustment for the local exposure middle grey.\n0: no adjustment, -1:2x darker, -2:4x darker, 1:2x brighter, 2:4x brighter, ..."),CategoryName="Lens|Local Exposure",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(121)=(PropertyName="LensFlareIntensity",PropertyFriendlyName="Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LensFlareIntensity", "Brightness scale of the image cased lens flares (linear)"),CategoryName="Lens|Lens Flares",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(122)=(PropertyName="LensFlareTint",PropertyFriendlyName="Tint",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LensFlareTint", "Tint color for the image based lens flares."),CategoryName="Lens|Lens Flares",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(123)=(PropertyName="LensFlareBokehSize",PropertyFriendlyName="BokehSize",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LensFlareBokehSize", "Size of the Lens Blur (in percent of the view width) that is done with the Bokeh texture (note: performance cost is radius*radius)"),CategoryName="Lens|Lens Flares",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(124)=(PropertyName="LensFlareThreshold",PropertyFriendlyName="Threshold",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LensFlareThreshold", "Minimum brightness the lens flare starts having effect (this should be as high as possible to avoid the performance cost of blurring content that is too dark too see)"),CategoryName="Lens|Lens Flares",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(125)=(PropertyName="LensFlareBokehShape",PropertyFriendlyName="BokehShape",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:LensFlareBokehShape", "Defines the shape of the Bokeh when the image base lens flares are blurred, cannot be blended"),CategoryName="Lens|Lens Flares",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(126)=(PropertyName="VignetteIntensity",PropertyFriendlyName="Vignette Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:VignetteIntensity", "0..1 0=off/no vignette .. 1=strong vignette"),CategoryName="Lens|Image Effects",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(127)=(PropertyName="FilmGrainIntensity",PropertyFriendlyName="Film Grain Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:FilmGrainIntensity", "0..1 Film grain intensity to apply. LinearSceneColor *= lerp(1.0, DecodedFilmGrainTexture, FilmGrainIntensity)"),CategoryName="Film Grain",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(128)=(PropertyName="FilmGrainIntensityShadows",PropertyFriendlyName="Film Grain Intensity Shadows",CategoryName="Film Grain",bCanToggleVisibility=True,bHasOverridePin=True)

                ShowPinForProperties(133)=(PropertyName="FilmGrainHighlightsMax",PropertyFriendlyName="Film Grain Highlights Max",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:FilmGrainHighlightsMax", "Should be set larger than HighlightsMin. Default is 1.0, for backwards compatibility"),CategoryName="Film Grain",bCanToggleVisibility=True,bHasOverridePin=True)

                ShowPinForProperties(135)=(PropertyName="FilmGrainTexture",PropertyFriendlyName="Film Grain Texture",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:FilmGrainTexture", "Defines film grain texture to use."),CategoryName="Film Grain",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(136)=(PropertyName="AmbientOcclusionIntensity",PropertyFriendlyName="Intensity",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionIntensity", "0..1 0=off/no ambient occlusion .. 1=strong ambient occlusion, defines how much it affects the non direct lighting after base pass"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(137)=(PropertyName="AmbientOcclusionStaticFraction",PropertyFriendlyName="Static Fraction",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionStaticFraction", "0..1 0=no effect on static lighting .. 1=AO affects the stat lighting, 0 is free meaning no extra rendering pass"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(138)=(PropertyName="AmbientOcclusionRadius",PropertyFriendlyName="Radius",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionRadius", ">0, in unreal units, bigger values means even distant surfaces affect the ambient occlusion"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True)
                ShowPinForProperties(139)=(PropertyName="AmbientOcclusionRadiusInWS",PropertyFriendlyName="Radius in WorldSpace",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionRadiusInWS", "true: AO radius is in world space units, false: AO radius is locked the view space in 400 units"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(140)=(PropertyName="AmbientOcclusionFadeDistance",PropertyFriendlyName="Fade Out Distance",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionFadeDistance", ">0, in unreal units, at what distance the AO effect disppears in the distance (avoding artifacts and AO effects on huge object)"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)

                ShowPinForProperties(142)=(PropertyName="AmbientOcclusionPower",PropertyFriendlyName="Power",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionPower", ">0, in unreal units, bigger values means even distant surfaces affect the ambient occlusion"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
                ShowPinForProperties(143)=(PropertyName="AmbientOcclusionBias",PropertyFriendlyName="Bias",PropertyTooltip=NSLOCTEXT("UObjectToolTips", "PostProcessSettings:AmbientOcclusionBias", ">0, in unreal units, default (3.0) works well for flat surfaces but can reduce details"),CategoryName="Rendering Features|Ambient Occlusion",bCanToggleVisibility=True,bHasOverridePin=True,bIsMarkedForAdvancedDisplay=True)
